OOSE_SCHEME_NAME_ALREADY_CREATED_IN_THE_LOCAL_SCHEME_SECTION:"Zvolte n\u00e1zev sch\u00e9matu ji\u017e vytvo\u0159en\u00fd v odd\u00edlu M\u00edstn\u00ed sch\u00e9ma. Tento n\u00e1zev je t\u0159eba zadat, pokud je pole [Distribuovan\u00e9 referen\u010dn\u00ed sch\u00e9ma] pr\u00e1zdn\u00e9.",INTL_LABEL_TICK_THIS_FIELD_TO_PERSIST_THE_CACHES_UNDER_THIS_CACHE_SCHEME:"Toto pole za\u0161krtn\u011bte, chcete-li v r\u00e1mci tohoto sch\u00e9matu pam\u011bt\u00ed cache trvale ukl\u00e1dat pam\u011bti cache. Tuto volbu je t\u0159eba zadat, pokud je pole [Distribuovan\u00e9 referen\u010dn\u00ed sch\u00e9ma] pr\u00e1zdn\u00e9.",INTL_LABEL_PROVIDE_SCHEME_NAME_OF_LOCAL_SCHEME_THIS_FIELD_MUST_NOT:"Zadejte n\u00e1zev m\u00edstn\u00edho sch\u00e9matu. Toto pole nesm\u00ed z\u016fstat pr\u00e1zdn\u00e9.",INTL_LABEL_SPECIFIES_THE_TYPE_OF_EVICTION_POLICY_TO_USE:"Ur\u010duje typ z\u00e1sad vy\u0159azen\u00ed, kter\u00e9 se maj\u00ed pou\u017e\u00edt.",INTL_LABEL_LEGAL_VALUES_ARE:"Platn\u00e9 hodnoty jsou:",INTL_LABEL_LRU_LEAST_RECENTLY_USED_EVICTION_POLICY_CHOOSES_WHICH_ENTRIES_TO:"LRU - Z\u00e1sady vy\u0159azen\u00ed Nejd\u0159\u00edve pou\u017eit\u00e9 vyberou z\u00e1znamy, kter\u00e9 se maj\u00ed vy\u0159adit, na z\u00e1klad\u011b toho, jak ned\u00e1vno byly zobrazeny. Vy\u0159azeny budou nejd\u0159\u00edve ty, kter\u00e9 nebyly zobrazeny nejdel\u0161\u00ed dobu.",INTL_LABEL_LFU_LEAST_FREQUENTLY_USED_EVICTION_POLICY_CHOOSES_WHICH_ENTRIES_TO:"LFU - Z\u00e1sady vy\u0159azen\u00ed Nejm\u00e9n\u011b \u010dasto pou\u017eit\u00e9 vyberou z\u00e1znamy, kter\u00e9 se maj\u00ed vy\u0159adit, na z\u00e1klad\u011b toho, jak \u010dasto b\u00fdvaj\u00ed zobrazeny. Vy\u0159azeny budou nejd\u0159\u00edve ty, kter\u00e9 b\u00fdvaj\u00ed zobrazeny nejm\u00e9n\u011b \u010dasto.",INTL_LABEL_HYBRID_HYBRID_EVICTION_POLICY_CHOOSES_WHICH_ENTRIES_TO_EVICT_BASED:"LRU - Z\u00e1sady vy\u0159azen\u00ed Hybridn\u00ed vyberou z\u00e1znamy, kter\u00e9 se maj\u00ed vy\u0159adit, na z\u00e1klad\u011b kombinace (v\u00e1\u017een\u00e9ho sk\u00f3re) toho, jak \u010dasto a jak ned\u00e1vno byly zobrazeny. Vy\u0159azeny budou nejd\u0159\u00edve ty, kter\u00e9 b\u00fdvaj\u00ed zobrazeny nejm\u00e9n\u011b \u010dasto a nebyly zobrazeny nejdel\u0161\u00ed dobu."
,INTL_LABEL_USED_TO_LIMIT_THE_SIZE_OF_THE_CACHE_CONTAINS_THE:"Slou\u017e\u00ed k omezen\u00ed velikosti pam\u011bti cache. Obsahuje maxim\u00e1ln\u00ed po\u010det jednotek, kter\u00e9 lze um\u00edstit do pam\u011bti cache, ne\u017e dojde k omezen\u00ed. Toto pole nesm\u00ed z\u016fstat pr\u00e1zdn\u00e9.",INTL_LABEL_SPECIFIES_THE_TYPE_OF_CACHE_UNIT_CALCULATOR_TO_USE_A:"Ur\u010duje typ v\u00fdpo\u010dtu jednotek pam\u011bti cache, kter\u00fd se m\u00e1 pou\u017e\u00edt. V\u00fdpo\u010det jednotek pam\u011bti cache slou\u017e\u00ed k ur\u010den\u00ed n\u00e1klad\u016f (v jednotk\u00e1ch) u dan\u00e9ho objektu. Toto pole nesm\u00ed z\u016fstat pr\u00e1zdn\u00e9.",INTL_LABEL_THE_CACHE_UNIT_FACTOR_SPECIFIES_THE_FACTOR_BY_WHICH_THE:"Faktor jednotek pam\u011bti cache ur\u010duje faktor, podle kter\u00e9ho se upravuj\u00ed jednotky, nejvy\u0161\u0161\u00ed a nejni\u017e\u0161\u00ed po\u010det. P\u0159i pou\u017eit\u00ed v\u00fdpo\u010dtu jednotek pam\u011bti cache je nap\u0159\u00edklad mo\u017en\u00e9 pou\u017e\u00edt faktor 1048576 pro po\u010d\u00edt\u00e1n\u00ed megabajt\u016f nam\u00edsto bajt\u016f. Toto pole nesm\u00ed z\u016fstat pr\u00e1zdn\u00e9.",INTL_LABEL_SPECIFIES_THE_AMOUNT_OF_TIME_FROM_LAST_UPDATE_THAT_ENTRIES:"Ur\u010duje dobu od posledn\u00ed aktualizace, po kterou jsou uchov\u00e1v\u00e1ny z\u00e1znamy v pam\u011bti cache, ne\u017e jsou ozna\u010deny jako pro\u0161l\u00e9. Toto pole nesm\u00ed z\u016fstat pr\u00e1zdn\u00e9.",INTL_LABEL_SPECIFIES_THE_NAME_OF_THE_SERVICE_THIS_FIELD_MUST_NOT:"Ur\u010duje n\u00e1zev slu\u017eby. Toto pole nesm\u00ed z\u016fstat pr\u00e1zdn\u00e9.",INTL_LABEL_SPECIFIES_THE_MAXIMUM_NUMBER_OF_DAEMON_THREADS_USAGE_OF_DAEMON:"Ur\u010duje maxim\u00e1ln\u00ed po\u010det vl\u00e1ken typu daemon. Pou\u017eit\u00ed vl\u00e1ken typu daemon se pro r\u016fzn\u00e9 typy slu\u017eeb li\u0161\u00ed. Pokud je hodnota nula nebo z\u00e1porn\u00e1, nepou\u017e\u00edv\u00e1 slu\u017eba vl\u00e1kna typu daemon a v\u0161echny relevantn\u00ed \u00falohy budou provedeny ve vl\u00e1kn\u011b slu\u017eby. D\u00e1le, pokud je hodnota z\u00e1porn\u00e1, budou \u00falohy tam, kde je to mo\u017en\u00e9, provedeny ve vl\u00e1kn\u011b volaj\u00edc\u00edho. Platn\u00e9 hodnoty jsou cel\u00e1 \u010d\u00edsla vy\u0161\u0161\u00ed ne\u017e hodnota elementu thread-count-min nebo s touto hodnotou shodn\u00e1. Toto pole nesm\u00ed z\u016fstat pr\u00e1zdn\u00e9.",INTL_LABEL_SPECIFIES_THE_MINIMUM_NUMBER_OF_DAEMON_THREADS_USAGE_OF_DAEMON:"Ur\u010duje minim\u00e1ln\u00ed po\u010det vl\u00e1ken typu daemon. Pou\u017eit\u00ed vl\u00e1ken typu daemon se pro r\u016fzn\u00e9 typy slu\u017eeb li\u0161\u00ed. Pokud je hodnota nula nebo z\u00e1porn\u00e1, nepou\u017e\u00edv\u00e1 slu\u017eba vl\u00e1kna typu daemon a v\u0161echny relevantn\u00ed \u00falohy budou provedeny ve vl\u00e1kn\u011b slu\u017eby. D\u00e1le, pokud je hodnota z\u00e1porn\u00e1, budou \u00falohy tam, kde je to mo\u017en\u00e9, provedeny ve vl\u00e1kn\u011b volaj\u00edc\u00edho. Platn\u00e9 hodnoty jsou cel\u00e1 \u010d\u00edsla ni\u017e\u0161\u00ed ne\u017e hodnota elementu thread-count-max nebo s touto hodnotou shodn\u00e1. Toto pole nesm\u00ed z\u016fstat pr\u00e1zdn\u00e9.",INTL_LABEL_TICK_THIS_FIELD_TO_ENABLE_CACHE_SERVICE_PROXY_IF_DISABLED:"Toto pole za\u0161krtn\u011bte, pokud chcete aktivovat server proxy slu\u017eby pam\u011bti cache. Pokud je toto pole deaktivov\u00e1no, nebudou m\u00edt klienty p\u0159\u00edstup k \u017e\u00e1dn\u00fdm pam\u011bt\u00edm cache na serveru proxy.",INTL_LABEL_TICK_THIS_FIELD_TO_AUTOMATICALLY_START_THIS_SERVICE_AT_A:"Toto pole za\u0161krtn\u011bte, pokud se m\u00e1 tato slu\u017eba automaticky spou\u0161t\u011bt na uzlu clusteru.",INTL_LABEL_GATEWAY_AUTHORIZATION_TOKEN:"Autoriza\u010dn\u00ed token br\u00e1ny",INTL_LABEL_PROVIDE_ENTERPRISE_CACHE_SERVER_AGENT_NODE_NAME_THIS_FIELD_MUST:"Zadejte n\u00e1zev uzlu agenta serveru pam\u011bti cache Enterprise. Toto pole nesm\u00ed z\u016fstat pr\u00e1zdn\u00e9.",INTL_LABEL_PROVIDE_ENTERP